        const target = event.target;
        const value = target.value;
        console.log(value);
        const name = target.name;
        this.setState({
          [name]: value
        });
    }

    handleDateChange(moment){
        console.log(moment._d);
        this.setState({
            date: moment._d,
        })
    }

