            for(var i=0; i < result.length; i++){
                var newDate = true;
                if (dates[dates.length-1]){
                    if (dates[dates.length-1].date === (new Date(result[i].assignment_due)).setHours(0,0,0,0)){
                        dates[dates.length-1].assignments.push(result[i]);
